import React from 'react';
import DarkMode from './DarkMode'; // Đảm bảo điều chỉnh đường dẫn nhập khẩu nếu cần
import Notification from './Notification';

const Secondary = ({ onToggleDarkMode, notifications, onDismissNotification }) => {
  return (
    <div className="secondary-container">
      <DarkMode onToggle={onToggleDarkMode} />
      {notifications.map(notification => (
        <Notification
          key={notification.id}
          message={notification.message}
          onClose={() => onDismissNotification(notification.id)}
        />
      ))}
    </div>
  );
};

export default Secondary;
